import React from "react";
import NavBar from "../components/NavBar";
import {Link} from "react-router-dom";

function Login() {
  return (
    <div>
      <NavBar />
      <Link to="/dashboard">
      <div className="absolute top-20 right-20">login</div>
      </Link>
    </div>
  );
}

export default Login;
